                <span className="close">
                    &times;
          </span>
                <form>
                    <h3>Register!</h3>
                    <label>
                        Name:
              <input type="text" name="name" />
                    </label>
                    <br />
                    <input type="submit" />
                </form>
            </div>
        </div>
    )
};

export default PopUp;
